data.query:
query MyQuery($storeId: String!, $firstNameLike: String!) {
  patients(storeId: $storeId, filter: { firstName: { like: $firstNameLike } }) {
    ... on PatientConnector {
      nodes {
        firstName
        lastName
        gender
      }
    }
  }
}

